window.bookSummaryJSON = "<p>Do you like gripping crime thrillers? Then discover the next unmissable chapter in the best-selling Dark Yorkshire Series.</p> <p>A murder without motive. A bombing. The sins of the past revisited....<br> &nbsp;</p> <p>DI Nathaniel Caslin is heading up a specialist unit, an opportunity to make a real difference. Little does he know, decisions taken decades previously are about to threaten all that he holds dear....<br> &nbsp;</p> <p>Gangland tensions are on the rise as an uneasy peace is fractured in spectacular fashion. Two warring factions are lining up to unseat the other. Old adversaries rekindle their passion to exact revenge whilst the next generation seek to make a name for themselves. Meanwhile, Caslin is asked to investigate the mysterious murder of a private detective, revealing the vested interests of a multitude of figures. Finding himself walking the line between upholding the law and delivering justice, Caslin sees the past returning to haunt those around him.<br> &nbsp;</p> <p>A crime perpetrated years previously sends ripples far and wide. Some people have much to gain whilst others have so much to lose...none more so than Caslin himself....<br> &nbsp;</p> <p>Intense, suspenseful, and gripping from the beginning to the end, <i>Fear the Past </i>is the latest installment in the international best-selling crime series by J M Dalgliesh. As with all the Dark Yorkshire books, <i>Fear the Past </i>can be enjoyed as a stand-alone thriller or listened to as the next chapter of the series. Buy it today!</p>"; 
